import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Updated import for Routes
import LoginForm from './pages/pasindu/LoginForm';
import Navbar from './components/Navbar'; // Ensure correct import path

const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar /> {/* Navbar component */}
        <Routes> {/* Replace Switch with Routes */}
          <Route path="/login" element={<LoginForm />} /> {/* Updated Route syntax */}
          <Route path="/" element={<h1>Home Page</h1>} /> {/* Add Home route if needed */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
